Jo mein Name ist Ric, bin 22, und suche einen DynQ Partner, am besten Mid/Top/Adc und vorzugsweise ebenfalls am smurfen (muss aber nicht sein). Ich maine Jungler seit S2, und will diesen Acc ebenfalls in den Plat/Dia Bereich bringen. (Main: Kaltn). Ihr solltet eure Lane beherrschen und nat&uuml;rlich in den meisten F&auml;llen gewinnen. TS sollte vorhanden sein, sowie dementsprechende Deutschkenntnisse :) Den Acc hab ich l&auml;nger nicht gespielt deswegen kann ich &uuml;ber die MMR nichts sagen, ich war S2 mit dem Gold auf 1700 Pkt, dann einige Spiele in S3 und seit dem nicht mehr angegriffen.

Hoffe es melden sich einige, die auch vorhaben l&auml;nger zusammen zu spielen, die ehrgeizig sind so wie ich und Spa&szlig; am Spiel sowie Spa&szlig; daran haben sich zu verbessern wegen Synergie und so ;)

